import React from "react";
import styled from "styled-components";
import {colorsRoles} from "../../01 Atoms/Colors";
import Button from "../../02 Molecules/Button";
import {LeftContent, LeftSide} from "../NavUxUIProjects/NavUxUIProjectsItem";


const NavCreativeDeveloperProjectItem = () => {
    return <>
        <Box>
            <LeftSide FieldTextColorVisible={props.FieldTextColorVisible} TextColor={props.TextColor}>
                <LeftContent>
                    <p>{props.fields}</p>
                    <h3>{props.title}</h3>
                    <p>{props.description}</p>
                    <Button pathname={props.slug} label={"See more"}/>
                </LeftContent>
            </LeftSide>
        </Box>
    </>

};

export default NavCreativeDeveloperProjectItem;

export const Box = styled.div`
position: relative;
width: 100%;
`;
